BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Recipe_FP" (
	"ID"	INTEGER,
	"Rname"	TEXT,
	"image"	TEXT,
	"description"	TEXT,
	"allergy_tags"	TEXT,
	"Dp_Tags"	TEXT,
	"Ctime"	NUMERIC,
	"calories"	INTEGER,
	PRIMARY KEY("ID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "MealPlan_FP" (
	"ID"	INTEGER,
	"RName"	INTEGER,
	"Dp_tags"	INTEGER,
	"allergy_tags"	INTEGER,
	"description"	INTEGER,
	PRIMARY KEY("ID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "AboutMe" (
	"height"	INTEGER,
	"Weight"	INTEGER,
	"age"	INTEGER,
	"allergy"	TEXT,
	"DP"	INTEGER,
	"BMI"	INTEGER,
	"UserID"	INTEGER,
	"cookingTime"	TEXT,
	"DietMethod"	TEXT,
	"DietaryPreferance"	TEXT,
	"HealthGoal"	TEXT,
	FOREIGN KEY("UserID") REFERENCES "User"("UserID")
);
CREATE TABLE IF NOT EXISTS "NewsFeed" (
	"ID"	INTEGER,
	"title"	TEXT,
	"source"	TEXT,
	"link"	TEXT,
	PRIMARY KEY("ID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "User" (
	"Username"	TEXT,
	"password"	TEXT,
	"email"	TEXT,
	"UserID"	INTEGER,
	"FName"	TEXT,
	"LName"	TEXT,
	"gender"	TEXT,
	"dob"	INTEGER,
	"UserType"	TEXT,
	PRIMARY KEY("UserID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "NutritionistSignUp" (
	"SignUpID"	INTEGER,
	"UserID"	INTEGER,
	"LinkedInURL"	TEXT,
	"LicenseImage"	BLOB,
	"UserPhoto"	BLOB,
	"ExperienceFile"	BLOB,
	"TestimonyFile"	BLOB,
	"Status"	TEXT DEFAULT 'Pending',
	FOREIGN KEY("UserID") REFERENCES "User"("UserID"),
	PRIMARY KEY("SignUpID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "review" (
	"UserID"	INTEGER,
	"ReviewID"	INTEGER,
	"comment"	TEXT,
	"Rname"	TEXT,
	"stars"	INTEGER,
	FOREIGN KEY("Rname") REFERENCES "Recipe_Np"("Rname"),
