CREATE TABLE IF NOT EXISTS "Recipe_Np" (
	"Rname"	TEXT,
	"instruction"	TEXT,
	"ratings"	TEXT,
	"review"	TEXT,
	"ingredients"	TEXT,
	"image"	TEXT,
	"description"	TEXT,
	"allergy_tags"	TEXT,
	"dp_tags"	TEXT,
	"tips_tricks"	TEXT,
	"info"	TEXT,
	"cTime"	TEXT,
	"calorie"	INTEGER,
	"UserID"	INTEGER,
	PRIMARY KEY("Rname")
);
CREATE TABLE IF NOT EXISTS "BPAnnouncement" (
	"UserID"	INTEGER,
	"file_name"	TEXT,
	"announcementFile"	BLOB
);
