INSERT INTO "Recipe_Np" VALUES ('Homemade Fish & Chips','For the Chips (French Fries):
1.Preheat your oven to 220C (425F).
2.Wash and peel the potatoes. Cut them into even-sized strips (thicker cuts for a fluffier interior).
3.Soak the cut potatoes in a bowl of cold water for about 30 minutes to remove excess starch.
4.After soaking, drain the water and thoroughly dry the potato strips with paper towels.
5.Toss the dried potato strips in a bowl with 1 tablespoon of oil, salt, and pepper until evenly coated.
6.Spread the potatoes on a baking tray lined with parchment paper.
7.Bake for 30-35 minutes or until golden brown and crispy, flipping them halfway through for even cooking.

For the Fish:
1.Pat the fish fillets dry with paper towels.
2.In separate shallow dishes, prepare two coatings; one with plain flour seasoned with salt, pepper, and dried mint, and the other with beaten eggs.
3.Dip each fillet first into the seasoned flour, then into the beaten egg, and finally coat it thoroughly with breadcrumbs.
4.Heat the remaining oil in a frying pan over medium-high heat.
5.Once the oil is hot, carefully add the breaded fish fillets to the pan.
6.Fry each fillet for about 3-4 minutes on each side until golden brown and the fish is cooked through. Place them on a paper towel-lined plate to drain excess oil.

For the Peas:
1.Boil the frozen garden peas according to the package instructions.
2.Drain the peas and return them to the pan.
3.Add the butter and a pinch of salt and pepper to the peas. Mash lightly or blend for a smoother consistency if preferred.

Plating:
1.Serve the crispy fish fillets alongside the golden brown chips.
2.Plate a portion of mashed peas on each serving plate.
3.Garnish with a wedge of lemon or your preferred condiments like tartar sauce or malt vinegar.
','4',NULL,'4 white Fish Fillet
100 g Breadcrumbs
4 Large Potatoes
400g Frozen Garden Peas
2 Eggs
Pinch of Salt and Pepper
2 teaspoons of Oil
20g Butter','/Fish&chips.jpg','This recipe for 2 is a healthy version of the otherwise stodgy and oil soaked fish and chips. The fish is lightly coated in breadcrumbs and baked, and the chips are tossed in a small amount of oil and cooked in the oven until golden. The peas are garden peas, crushed
and mixed with a bit of butter and mint. Nutritious, but still hits the spot when that chippy craving strikes.',NULL,NULL,'Selecting the Fish:Opt for fresh, firm white fish like cod, haddock, or halibut. The freshness of the fish is key to a great dish.|Double Fry Technique:Fry the fish twice for that perfect crunch. After an initial fry to cook the fish, let it rest, then fry it again briefly just before serving for that ultimate crispy texture.|Temperature Matters: Maintain a consistent oil temperature (around 350-375F or 175-190C) when frying. This ensures the fish cooks evenly and the batter turns golden brown without burning.|Oil Selection:Use oils with high smoke points like peanut, sunflower, or canola oil for frying. They can withstand higher temperatures without imparting unwanted flavours.','In some coastal areas, especially in the United Kingdom,it''s a tradition to serve fish and chips wrapped in newspaper.While this practice has declined due to food safety regulations, it originated during times of paper shortages and added a unique touch to the dining experience.
The world''s oldest surviving fish and chip shop is thought to be Malin''s Fish and Chips in Ynys Mon, Wales.It has been serving this classic dish since 1860, providing a fascinating historical perspective on the enduring appeal of fish and chips.','20 to 30','Around 2624 calories,Approximately 99 grams,Roughly 25 grams,About 397 grams,Around 51 grams',NULL);
INSERT INTO "Recipe_Np" VALUES ('Vegetarian Burrito','1.In a large microwave-safe bowl, toss together cooked rice and fresh chopped cilantro, and drizzle with the lime juice. Heat in the microwave or on the stove just until hot and give it a quick stir.

2.In a separate large skillet, saut the onion in vegetable oil or olive oil for 5 minutes, or until the onion is soft. Add the garlic and cook another minute.

3.Reduce the heat to medium-low, add the black beans or Pinto beans, and season with the Chili powder, cumin, and hot sauce, stirring to combine. You can add a bit of salt if you''d like, but you shouldn''t need too much with all the other seasoning. Allow the beans to cook until heated through, about 5 minutes.

4.Spoon the cilantro-lime rice and the black bean mixture onto lightly warmed flour tortillas and add any additional toppings you want.

5.Wrap the burritos; Fold the short ends in, then fold one long side over the filling and gently push to ensure the fold is tight before rolling up the remainder of the burrito.

6.Cut in half and serve immediately.

Plating:
1.Remember, the key to a great presentation is to balance colours,textures, and flavours. 

2.Feel free to get creative and adapt the plating based on the specific type of tortilla dish you''re serving.

3.Whether it''s tacos, quesadillas, or enchiladas, a well-plated presentation can enhance the dining experience.
     
','3',NULL,' 2 cups Cooked Rice
 2 tablespoon Chopped Fresh Cilantro
 2 Limes Juiced 
  Diced Medium Onion
 3  4 Cloves Minced Garlic
 2 tablespoon Vegetable Oil 
 1 can Drained Black Beans
 4 large Temperatureortillas (10 inch)
  teaspoon Ground Cumin
 1 tablespoon Hot Sauce and Chili Powder','/veg burrito.jpg','Quick and easy, vegan bean and rice burritos are a perfectvegetarian dinner idea. This basic recipe includes plenty of Mexican spices, is a great way to use up leftover rice, and can be customized to whatever you have on hand.',NULL,NULL,'Whole Grain Tortillas:Opt for whole grain or whole wheat tortillas for added fiber.They''re a healthier choice compared to refined flour tortillas.|Layering Technique: When assembling the burrito, start with the sturdier ingredients
like beans or rice at the base, followed by softer ingredients to
prevent the tortilla from getting soggy.| Proper Rolling Technique:Fold the sides of the tortilla inward, then fold the bottom over the filling and roll tightly. This helps keep everything intact while eating.|Serving Accompaniments:Serve with a side of Greek yogurt or a light avocado-based dressing as a healthier alternative to sour cream.','In Spanish, the word burrito means little donkey. It means the diminutive form of burro, or donkey.
The name burrito possibly derives from the tendency of burritos to contain a lot of items at a time just like a donkey is able to carry a lot of burden','10 to 20','Around 370 - 450 calories (Varies based on specific ingredients and amount used),Approximately 15 grams,Roughly 10 grams,About 68 grams,Around 19 grams',NULL);
INSERT INTO "Recipe_Np" VALUES ('Steamed Egg','1.Prepare steamer. In a bowl, crack 4 eggs and mix it evenly with a pair of chopsticks.

2.Add water (double the amount of egg), salt and white pepper into the beaten eggs and mix till it becomes homogenous.

3.Strain the mixture through a sieve into a deep plate or bowl. Discard the leftover egg mixture that didn''t make it through the sieve.

4.Remove the bubbles on the surface of the egg mixture with a spoon.

5.Cover with aluminium foil and steam the egg mixture for 15 minutes in the pre-heated steamer at low to medium heat.

6.Meanwhile, combine light soy sauce, sesame oil and 1 tbsp water in a bowl. Once the steamed egg is ready, gently pour the soy sauce mixture and garnish with the chopped spring onions before serving.

Plating:
Remember, the key to a well-plated dish is balance and simplicity. Let the natural beauty of the steamed eggs shine through, and use garnishes to enhance both the visual appeal and the flavor. 
','1.5',NULL,'  tablespoon salt
 4 eggs
 400g water
  tablespoon white pepper
 1 tablespoon light soy sauce
  tablespoon sesame oil 
 Pinch of Salt and Pepper
 1 tbsp	water (for sauce)
 1 cup	chopped spring onions
 20g Butter','/steamed egg.jpg','Soft, silky and smooth steamed egg is commonly cooked in many Chinese households. Prevent watery eggs by using the golden ratio and a few simple tips. In less than 20 minutes, you can prepare this savoury custard loved by babies, kids and adults alike.
         ',NULL,NULL,'Seasoning:Experiment with seasonings to suit your taste. A pinch of salt, a dash of white pepper, and a splash of soy sauce can elevate the flavor. Consider adding a touch of sesame oil for depth.|Toppings and Garnishes:Customize your steamed eggs with toppings like chopped green onions, cilantro, or a sprinkle of toasted sesame seeds. A drizzle of oyster sauce or a few drops of chili oil can add complexity.|Water Ratio: Control the water ratio in the steaming process. Too much water can lead to a wet surface on the steamed eggs. Aim for a gentle steam, and cover the dish with a lid or foil to prevent condensation.|Steaming Time:Steaming time is crucial. Oversteaming can result in a rubbery texture, while understeaming may leave the eggs watery. Aim for a custard-like consistency by checking doneness with a toothpick or fork.','Steamed eggs have a long history and have been enjoyed for centuries. In ancient China, a dish called "luweidan" was a precursor to modern steamed eggs. It was often served to Chinese emperors during the Tang Dynasty (618-907 AD) and is a testament to the enduring appeal and sophistication of this seemingly simple culinary creation.
In Japan, there is an intricate and traditional method of making steamed eggs known as "Tamagoyaki." Chefs skilled in this artistry create thin layers of egg, delicately rolled to form a log. What makes it mind-blowing is the precision and patience requiredsometimes over 20 layers are meticulously crafted, resulting in a visually stunning and flavorful culinary masterpiece. The layers are so meticulously done that some chefs can create intricate designs within the layers, showcasing an extraordinary level of culinary skill and artistry.','40 to 50 ','Approximately 70-90 calories,7-9 grams,4-6 grams,1-2 grams,180-200 milligrams',NULL);
INSERT INTO "Recipe_Np" VALUES ('Bibimbap','1.Mix the beef mince with the meat sauce listed above. Marinate the meat for about 30 mins while you are working on other ingredients to enhance the flavour. Add some cooking oil into a wok and cook the meat on medium high to high heat. It takes about 3 to 5 mins to thoroughly cook it.

2.Mix the bibimbap sauce ingredients in a bowl and cook spinach and bean sprouts for 1-2 minutes.

3.Rinse, peel and julienne the carrots. Add some cooking oil and tsp of fine sea salt in a wok and cook the carrots on medium high to high heat for 2 to 3 mins.

4.Clean/rinse the shiitake mushrooms and thinly slice them. Add some cooking oil and tsp of fine sea salt in a wok and cook the mushrooms on medium high to high heat until they are all cooked. (It takes 2 to 3 mins.)

5.Make fried eggs. (While sunny side up is common, you can make them per your preference.)

6.Put the rice into a bowl and add the meat, assorted vegetables, seasoned seaweed, bibimbap sauce, and the egg on top of the rice. Serve.

Plating:
Remember, plating is an opportunity to express your creativity, so feel free to adjust the arrangement based on your preferences and the aesthetic you desire.
','2.5',NULL,'  cup Cooked Rice
1 cup Assorted Vegetables (spinach,carrots,beansprouts,
mushrooms, zucchini)
  cup Marinated Beef or Tofu (for a vegetarian option)
 1 Egg
 1 tablespoon Gochujang (Korean red pepper paste)
 1 tablespoon Soy Sauce 
 1 teaspoon Sesame Oil
 1 teaspoon Sesame Seeds
 1 Clove Garlic, Minced
  teaspoon Sugar
 1 teaspoon Rice Vinegar','/bibimbap.jpg','Bibimbap (), a vibrant Korean dish, intricately weaves together an array of fresh vegetables, tender meats or tofu, and a spicy gochujang sauce atop steamed rice. Beyond its visually striking presentation lies a nutritional powerhouse, boasting an abundance of vitamins, minerals,and antioxidants from its colourful ingredients. This one-bowl wonder offers not just a meal but an exploration of flavours, textures, and the rich tapestry of Korean culinary heritage.',NULL,NULL,'Rice Quality:Use short-grain or medium-grain rice for an authentic Korean bibimbap experience. Cook it slightly firm to maintain a chewy texture.|Sesame Seeds and Seaweed: Toast sesame seeds lightly for a nutty aroma and sprinkle them on top for added crunch. Consider adding a sheet of toasted seaweed (gim) for a traditional touch.|Dolsot Bibimbap Variation:
For a unique twist, consider serving bibimbap in a hot stone bowl (dolsot). This adds a crispy rice layer at the bottom, providing contrasting textures.|Gochujang Balance: Adjust the amount of gochujang (Korean red chili paste) to your spice preference. It not only adds heat but also contributes a complex and savory flavor. Consider adding a bit of honey for a touch of sweetness.
','Bibimbap, a beloved Korean dish, has roots that trace back to the 14th-century Joseon Dynasty. It was considered a royal court dish and featured a variety of colorful and nutritious vegetables arranged beautifully on top of a bed of rice.
Bibimbap has made its mark on the international culinary scene and even took a trip to space! In 2008, South Korea''s 
first astronaut, Ko San, brought a version of bibimbap aboard the Russian spacecraft Soyuz. The dish was specially prepared to withstand the conditions of space travel,highlighting the cultural significance of Korean cuisine on a global scale.','60','Around 500 - 600 calories (Varies based on specific ingredients and amount used),Approximately 25 grams, Roughly 20 grams,About 80 grams,Around 8 grams',NULL);
INSERT INTO "Recipe_Np" VALUES ('ABC Soup',' 1.In a large pot, cook the chopped bacon over medium heat until it becomes crispy. Remove some of the excess fat if there''s too much. 
 2.Add the diced onions and minced garlic to the pot, sauteing until the onions are translucent.
 3. Add the sliced mushrooms, carrots, and potatoes to the pot. Stir and cook for a few minutes to allow the vegetables to slightly soften.
 4.Pour in the chicken or vegetable broth, and add the bay leaf and dried thyme if using. Bring the soup to a boil.
  5.Reduce the heat to low, cover the pot, and let it simmer for about 15-20 minutes or until the vegetables are tender.
  6.Add the corn kernels to the soup and simmer for an additional 5 minutes.
  7.Season the soup with salt and pepper to taste. Adjust the seasoning as needed.
  8.Remove the bay leaf if used, and discard it.
  9.Serve the ABC soup hot, garnished with fresh herbs if desired.
  
  Plating:
   Remember, the key is to keep it simple and let the natural colors and textures of the ingredients shine through. 
 This approach not only makes the dish visually appealing but also enhances the overall dining experience.','3.5',NULL,'1 cup of sliced white mushrooms
 1 cup of corn
 1 large carrot
 1 onion
 8 cups of chicken broth
 Pinch of Salt and Pepper
 1 large potato 
 1 tablespoon of  dried thyme
 1 bayleaf(optional)','/ABC soup.jpg','ABC soup is a nourishing soup cooked with potatoes, carrots, tomatoes, onions and pork ribs/bones or chicken. This nutritious ABC soup with many vitamins contained therein is baby/childfriendly. It could also be easily turned into a vegetarian soup by omitting the meat.',NULL,NULL,'Selecting Stock/Broth:Use homemade chicken or vegetable broth for richer flavor. If using store-bought, choose low-sodium options to control salt levels.|Selecting Mushrooms:Consider using a mix of different mushrooms for depth of flavor. Shiitake or cremini mushrooms can add a more robust taste.|Herbs:Fresh herbs like parsley or thyme can elevate the soup. Add them towards the end of cooking for a burst of freshness.|Serve Fresh:ABC soup is best enjoyed fresh, but you can prepare the base in advance and add fresh vegetables just before serving for optimal texture.','ABC Soup is not only known for its nutritional value but also for its ability to evolve in flavor over time.Many enthusiasts claim that the soup tastes even better when reheated the next day. The ingredients have more time to mingle,allowing the flavors to deepen and create a more robust and savory broth. This quality adds an intriguing dimension to the soup,making it a favorite for leftovers.
ABC soup reflects the cultural blending in Southeast Asian cuisine. While the dish has its roots in Chinese cooking, it has become a staple in many Singaporean and Malaysian households. The simplicity of ingredients and the adaptability to different dietary preferences showcase how culinary traditions can evolve and adapt over time.','60','Approximately 200-250 calories,8-10 grams,8-10 grams,About 397 grams,4-6 grams',NULL);
