INSERT INTO "Recipe_Np" VALUES ('Avocado Brownies','1. Preheat the oven to 350F then lightly grease an 8 x 8 baking dish.
2. In a blender, combine the avocado, soymilk, maple syrup and coconut sugar. Blend for about 15-20 seconds, until smooth.
3. In a large bowl, combine the spelt flour, cocoa powder, baking soda and salt then stir together.
4. Pour the wet ingredients in the blender into the bowl with the dry.
5. Add the chocolate chips and stir together until combined.
6. Sprinkle a handful of chocolate chips on top then bake in the oven for 15-20 minutes, until set.
7. Stick a fork in the center and have it come out clean.
8. Allow to cool for at least 15 minutes before serving.
','','','	medium ripe avocado
1 cup + 2 tbsp silk organic soymilk unsweetened
 cup	pure maple syrup
  cup	coconut sugar
1 cup 	sprouted whole grain spelt flour
 cup	unsweetened cocoa powder
1 tsp  	baking soda
  tsp	salt
  cup	dark chocolate chips',X'','These Healthy Avocado Brownies are a healthy avocado brownie recipe made with wholesome ingredients. No oil, no eggs, or flour is needed.
Plus, this brownie is ready in 30 minutes in the bowl of your food processor.
','','','Get the texture right from step one. The key to capturing that smooth, cake-batter-like texture is to get the avocado perfectly smooth in the beginning. If youre having trouble mashing and mixing to smooth perfection, dont be afraid to get out the food processor.
Make it gluten-free. This recipe can be made gluten-free by swapping the all-purpose wheat flour with gluten-free all-purpose flour at a one-to-one ratio.
Skip the refined sugar. To avoid refined sugar completely, opt for brown coconut sugar or raw, unrefined brown sugar in place of traditional brown sugar. Raw sugar is completely vegan, unlike refined sugar which is often filtered using bone char.
','They are a healthier alternative to traditional brownies because they use avocado as a substitute for butter. Avocado is rich in healthy fats and provides a creamy texture to the brownies. Plus, avocado brownies are gluten-free, grain-free, and can be enjoyed by people with different dietary lifestyles.','30','Calories = 206 kcal
Carbs = 38 g
Fat = 8 g
Protein = 5 g
Sugar = 21 g
Sodium = 276 mg
',56);
